@extends('layouts.admin.app')

@section('title', 'Dashboard')

@section('content')
    <style>
        .card-text-large {
            font-weight: 600;
            font-size: 80px;
        }

        .card-text-medium {
            font-weight: 600;
            font-size: 30px;
        }

        .card-text-welcome {
            font-weight: 600;
            font-size: 30px;
        }

        .hover-box {
            position: absolute;
            display: flex;
            justify-content: center;
            align-items: center;
            border: 2px solid black;
        }

        .hover-box:hover {
            background-color: red;
        }

        .btn-toggle {
            background-color: white;
            color: #2D777A;
            border-radius: 15px;
            font-family: sans-serif;
            font-weight: normal;
            box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
        }

        .btn-toggle:hover {
            background-color: white;
        }

        .image-container {
            display: flex;
            justify-content: center;
            align-items: center;
            background-color: #f0f0f0;
        }

        .animation:hover {
            fill: #BFA045;
            background-color: #BFA045;
            color: white;
            cursor: pointer;
        }

        svg {
            width: 100%;
        }

        .centered-image {
            display: block;
            margin: 0 auto;
            max-width: 100%;
            height: auto;
            position: relative;
        }
    </style>
