<script src="https://ajax.googleapis.com/ajax/libs/jquery/3.5.1/jquery.min.js"></script>
<script src="https://maxcdn.bootstrapcdn.com/bootstrap/4.5.2/js/bootstrap.min.js"></script>
<script src="https://cdn.jsdelivr.net/npm/axios/dist/axios.min.js"></script>
<script>
    $(document).ready(function() {
        let isSecond = false;
        const toggleFloorBtn = $('#toggleFloorBtn');
        const toggleFloorText = $('#toggleFloorText');
        const floor1 = $('#floor1');
        const floor2 = $('#floor2');

        toggleFloorBtn.on('click', function() {
            isSecond = !isSecond;
            if (isSecond) {
                toggleFloorText.text('2nd Floor');
                floor1.hide();
                floor2.show();
            } else {
                toggleFloorText.text('1st Floor');
                floor2.hide();
                floor1.show();
            }
        });

        const roomData = {
            'humas': {
                name: 'Ruangan Humas',
                status: 'Nyala',
                people: 5,
                selector: '.humas'
            },
            'international-office': {
                name: 'International Office',
                status: 'Mati',
                people: 2,
                selector: '.international-office'
            },
            'wr-1': {
                name: 'Ruangan WR-1',
                status: 'Nyala',
                people: 10,
                selector: '.wr-1'
            }
        };

        function updateFillColor() {
            for (const key in roomData) {
                const room = roomData[key];
                if (room.status === 'Nyala') {
                    $(room.selector).attr('fill', '#3eeb09');
                } else {
                    $(room.selector).attr('fill', '#494d54');
                }
            }
        }

        updateFillColor();

        $('.humas, .international-office, .wr-1').on('click', function() {
            const roomClass = $(this).attr('class').split(' ').filter(c => roomData[c])[0];
            const roomInfo = roomData[roomClass];

            $('#roomName').text(`Nama Ruangan: ${roomInfo.name}`);
            $('#roomStatus').text(`Status: ${roomInfo.status}`);
            $('#roomPeople').text(`Jumlah Orang: ${roomInfo.people}`);

            updateFillColor();
            
            $('#infoModal').modal('show');
        });

        $('.close-modal, .close').on('click', function() {
            $('#infoModal').modal('hide');
        });
    });
</script>
@endsection
